INSERT INTO `products` VALUES ('bxASizbajxTQhRF1aV7K3','PSKU_IGV5QIN7HYEI649892',NULL,2,0,1,'20W USB-C 3-Pin Power Adapter / (Original iPhone Charger) - White',873.10,'EGP','The Apple 20W USB‑C Power Adapter offers fast, efficient charging at home, in the office, or on the go. While the power adapter is compatible with any USB‑C-enabled device, Apple recommends pairing it with the iPad Pro and iPad Air for optimal charging performance. You can also pair it with iPhone 8 or later to take advantage of the fast-charging feature.\nHighlights\nFast charging for iPhone and iPad with USB‑C compatibility\nDelivers optimal 20W output for quick power-up\nIdeal for iPhone 8 and later models for fast-charge capability\nCompact, lightweight design for travel and daily use\nWorks with any USB-C enabled device\nApple original accessory ensuring safety and reliability','2025-10-12 23:40:21','2025-10-13 21:02:49','UCPz0KH_FGr3cVv6Unc00',NULL,3,0,1,873.1),('TfdTzOJmrlxked4QdKm8f','PSKU_UEG4GNA460XX0FU953',NULL,4,0,1,'Electric Scooter 4 Lite (2nd Gen) |300W motor | 25 km/h Max Speed | 25 km travel range 121.9cm 121.9cm',16999.00,'EGP','The Xiaomi Mi Electric Scooter 4 Lite (2nd Gen) offers a top speed of 25 km/h and a range of up to 25 km, powered by a 300W motor with a peak output of 500W. Its 10-inch pneumatic tires ensure a smooth ride, while the dual braking system provides reliable stopping power. Weighing just 16.2 kg, the scooter features a foldable design for easy transport. The Smart Battery Management System (BMS) and Mi Home app connectivity allow for efficient battery monitoring and firmware updates. Ideal for daily commuting, this scooter combines performance, safety, and convenience.\nHighlights\nMax speed 25 km/h, 25 km range, 300W motor (500W peak)\n10\" pneumatic tires for comfort and stability\nDual braking system with front drum and rear E-ABS\nLightweight foldable frame weighing 16.2 kg\nSmart BMS and Mi Home app connectivity for battery management\nTake hold of freedom and ride at your own pace:Three riding modes are designed for various scenarios, allowing you to ride at your own speed. Pedestrian mode 6km/h. Standard mode 15km/h. Sport mode 25km/h\nHigh-brightness headlight:A lighting range of 2–8 meters, providing you with a clear view and ensuring your safety during night rides.\nEye-catching taillight: Flashing signals to alert pedestrians and vehicles behind, enhancing riding safety.\nDual brake system to ensure efficiency and reliability:The drum brake and rear E-ABS deliver efficient braking and reduce the braking distance, ensuring a safe and stable ride.\nConnect to Mi Home/Xiaomi Home app for data sharing:Once connected to Mi Home/Xiaomi Home app, you will have access to a variety of functions, allowing you to manage your travel data effectively and enjoy your rides to the full.','2025-10-24 02:27:04','2025-10-24 06:05:57','lA33bXclzxGkiZsBUES-B',NULL,3,1,1,16999);
